  [],\n\t\"revision_timestamp\": \"2016-10-15T16:36:26.786201\",\n\t\"name\": \"missisquoi-national-wildlife-refuge-annual-narrative-report-calendar-year-1986\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Missisquoi
  National Wildlife Refuge outlines Refuge accomplishments for the 1986 calendar year.
  The report begins with an introduction to the Refuge and describes climate and habitat
  conditions, and land acquisition. The planning section discusses management plans,
  public participation, compliance with environmental and cultural resource mandates,
  and research and investigations. Administration topics are covered, including: personnel,
  youth programs, volunteer programs, funding, safety, and technical assistance. Habitat
  management is covered; grasslands, wetlands, haying, fire management, pest control,
  and water rights are discussed. The wildlife section of the report discusses endangered
  and threatened species, migratory birds, raptors, game mammals, animal control,
  and marking and banding. Interpretation and recreation activities are outlined;
  topics include information and interpretation, recreational uses, and law enforcement.
  The equipment and facilities section discusses new construction, rehabilitation,
  major maintenance, and equipment utilization and replacement. Cooperative programs
  and items of interest are discussed. Photographs and brochures are attached.\",\n\t\"license_title\":
